import React,{Component} from 'react'



class Footer extends Component
{
    render()
    {
        return(
            <>
                <div className="container-fluid bg-dark text-white text-center p-5 ">

                    &copy; 2020 Software Engineer  &reg; | All rights reserved

                </div>
            </>
        )
    }
}





export default Footer;
